import badge from "../assets/icons/badge.png";
import eth from "../assets/icons/eth.png";
import heart from "../assets/icons/heart.png";
import left from "../assets/icons/left.png";
import search from "../assets/icons/search.png";


import fight_stage from "../assets/images/fight_stage.png";
import damage_control_stage from "../assets/images/damage_control_stage.jpeg";
import recovery_stage from "../assets/images/recovery_stage.jpeg";
import adaptation_stage from "../assets/images/adaptation_stage.jpeg";
import burnout_stage from "../assets/images/burnout_stage.jpeg";


export default {
  badge,
  eth,
  heart,
  left,
  search,

  fight_stage,
  damage_control_stage,
  recovery_stage,
  adaptation_stage,
  burnout_stage
};
